import React from "react";
import styled from "styled-components";
import NavbarComp from "../UI/NavbarComp";

const AboutBanner = () => {
  return (
    <Container>
      <NavbarComp />
    </Container>
  );
};
export default AboutBanner;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  color: white;
`;
